('6aa8be4d-5ffc-41bc-8109-f1409b96f3ff', 'ยี่ห้อ Wincode รุ่น c342', 'Wincode', 'c342', '<p><strong>จุดเด่นสินค้า</strong></p>\r\n<ul>\r\n<li>สามารถพิมพ์จากลิสต์ข้อมูลใน Excel ได้</li>\r\n<li>ราคาถูกกว่าเครื่องตัวอื่นที่มีสเปคเทียบเคียงกัน</li>\r\n<li>เหมาะสำหรับ การพิมพ์ที่อยู่ส่งของให้ลูกค้า หรือพิมพ์รายละเอียดสินค้าจำนวนมากที่รายละเอียดต่อชิ้นต่างกัน</li>\r\n</ul>\r\n<p><strong>สเปค</strong><strong>สินค้า</strong><br />ระบบการพิมพ์ : โอนถ่ายความร้อนผ่านผ้าหมึก และโอนถ่ายความร้อนโดยตรง<br />ความละเอียดในการพิมพ์ : 203 จุด/นิ้ว<br />ความเร็วในการพิมพ์สูงสุด : 4 นิ้ว/วินาที<br />หน้ากว้างในการพิมพ์ : 4.25 นิ้ว<br />ความยาวในการพิมพ์ : 90 นิ้ว<br />หน่วยความจำ : Flash 8 MB, SDRAM 8 MB<br />การเชื่อมต่อ : USB 2.0<br />ใช้กับริบบอน : 110 มม. x 300 ม. (แกน 1 นิ้ว)<br />โปรแกรมบาร์โค้ด : ฟรี วินเลเบล</p>', 'printer-small', '<p><strong>การรับประกันสินค้า</strong><br />รับประกันตัวเครื่อง 12 เดือน<br />รับประกันหัวพิมพ์ 3 เดือน หรือ 25 กิโลเมตร</p>', 'https://firebasestorage.googleapis.com/v0/b/gunner-barcode.appspot.com/o/printer-small%2FWincodeC342.jpg?alt=media&token=abaf4cd9-10c8-4d34-9687-3714420f7474', 0, 500, 0),
